import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <h1>Mr. S. Sahan</h1>
      <div className="header-actions">
        <button className="message-button">Messages</button>
        <button className="logout-button">Log Out</button>
      </div>
    </header>
  );
}

export default Header;
